package domen;

public class Igraonica {
	
	private String naziv,kontaktOsoba,email,telefon,web;
	private int idIgraonica;
	
	


	public Igraonica() {
		// TODO Auto-generated constructor stub
	}




	/**
	 * @return the naziv
	 */
	public String getNaziv() {
		return naziv;
	}




	/**
	 * @param naziv the naziv to set
	 */
	public void setNaziv(String naziv) {
		this.naziv = naziv;
	}




	/**
	 * @return the kontaktOsoba
	 */
	public String getKontaktOsoba() {
		return kontaktOsoba;
	}




	/**
	 * @param kontaktOsoba the kontaktOsoba to set
	 */
	public void setKontaktOsoba(String kontaktOsoba) {
		this.kontaktOsoba = kontaktOsoba;
	}




	/**
	 * @return the email
	 */
	public String getEmail() {
		return email;
	}




	/**
	 * @param email the email to set
	 */
	public void setEmail(String email) {
		this.email = email;
	}




	/**
	 * @return the telefon
	 */
	public String getTelefon() {
		return telefon;
	}




	/**
	 * @param telefon the telefon to set
	 */
	public void setTelefon(String telefon) {
		this.telefon = telefon;
	}




	/**
	 * @return the web
	 */
	public String getWeb() {
		return web;
	}




	/**
	 * @param web the web to set
	 */
	public void setWeb(String web) {
		this.web = web;
	}




	/**
	 * @return the idIgraonica
	 */
	public int getIdIgraonica() {
		return idIgraonica;
	}




	/**
	 * @param idIgraonica the idIgraonica to set
	 */
	public void setIdIgraonica(int idIgraonica) {
		this.idIgraonica = idIgraonica;
	}

}